PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE `user_forms` (
                              `id` INTEGER NOT NULL,
                              `name` TEXT NOT NULL,
                              `email` TEXT NOT NULL,
                              `subject` TEXT NOT NULL,
                              `message` TEXT NOT NULL,
                              `read` BOOLEAN DEFAULT(FALSE),
                              `created_at` TEXT NOT NULL DEFAULT CURRENT_TIMESTAMP,
                              PRIMARY KEY (`id`)
);
CREATE TABLE `images` (
                          `id` INTEGER NOT NULL,
                          `src` TEXT NOT NULL,
                          `created_at` TEXT NOT NULL DEFAULT CURRENT_TIMESTAMP,
                          PRIMARY KEY (`id`)
);
